INSERT INTO `produit` (`code`, `nom`, `title`, `prix`, `qtr`, `qtv`, `codemr`, `codev`, `image`) VALUES
(1, 'Powerful Laptop', 'This sleek and powerful laptop is designed to meet all your computing needs. With its high-performance specifications and cutting-edge technology, it delivers exceptional speed and efficiency. Whether you are a student, professional, or gaming enthusiast, this laptop offers seamless multitasking and immersive entertainment. Its vibrant display and crystal-clear audio enhance your viewing and listening experience. The ergonomic design ensures comfortable usage, while the long-lasting battery keeps you productive throughout the day. Stay connected with the latest connectivity options and enjoy fast data transfer. Experience the future of computing with this remarkable laptop.', 1200, 31, 5, 1, 1, ''),
(2, 'Feature-packed Smartphone', 'Discover the world of limitless possibilities with this feature-packed smartphone. Its stunning display brings your content to life with vibrant colors and sharp details. Capture breathtaking photos and videos with the high-resolution camera and unleash your creativity. Powered by a fast and efficient processor, this smartphone offers smooth performance and seamless multitasking. Stay connected, browse the web, and download your favorite apps with lightning-fast speed. The sleek design and ergonomic build provide a comfortable grip. Elevate your mobile experience with this advanced smartphone.', 900, 0, 14, 1, 2, ''),
(3, 'Versatile Washing Machine', 'Make laundry days a breeze with this versatile washing machine. With its large capacity and multiple wash programs, it can handle all your laundry needs. The advanced technology ensures thorough cleaning and gentle care for your clothes. Save time and energy with efficient wash cycles and customizable settings. The user-friendly interface and intuitive controls make operation a breeze. Say goodbye to stains and hello to fresh, clean laundry with this reliable washing machine.', 600, 0, 20, 3, 3, ''),
(4, 'Powerful Vacuum Cleaner', 'Keep your home spotless with this powerful vacuum cleaner. Its high suction power and versatile attachments make it easy to clean every nook and cranny. Say goodbye to dust, dirt, and pet hair with this efficient cleaning tool. The lightweight and ergonomic design ensure easy maneuverability and hassle-free cleaning. With its advanced filtration system, it traps allergens and ensures cleaner air. Make cleaning a breeze with this reliable and efficient vacuum cleaner.', 150, 40, 0, 3, 4, ''),
(5, 'Durable Car Battery', 'Ensure your vehicle\'s reliability with this durable car battery. Designed to deliver consistent power, it provides reliable starting power in all weather conditions. With its long lifespan and maintenance-free design, it offers peace of mind and hassle-free operation. Say goodbye to battery-related issues and enjoy worry-free driving with this high-quality car battery.', 100, 60, 0, 5, 5, ''),
(6, 'Stylish Watch', 'Add a touch of elegance to your wrist with this stylish watch. Its sleek design and premium craftsmanship make it a perfect accessory for any occasion. The precise movement ensures accurate timekeeping, while the durable materials offer long-lasting durability. With its water resistance and scratch-resistant features, it can withstand everyday wear and tear. Elevate your style with this timeless and sophisticated watch.', 250, 0, 8, 4, 6, ''),
(7, 'Luxurious Perfume', 'Indulge your senses with this luxurious perfume. Its captivating fragrance evokes a sense of elegance and sophistication. The carefully selected ingredients blend harmoniously to create a unique and memorable scent. Whether for a special occasion or daily use, this perfume leaves a lasting impression. The elegant bottle design adds a touch of refinement to your vanity. Experience the essence of luxury with this exquisite perfume.', 80, 14, 5, 6, 7, ''),
(8, 'Gourmet Coffee', 'Awaken your senses with this gourmet coffee. Sourced from the finest coffee beans, it offers a rich and complex flavor profile. The carefully crafted roasting process enhances the natural aromas and creates a smooth and balanced taste. Whether you prefer a strong espresso or a mellow cappuccino, this coffee delivers a satisfying and indulgent experience. Brew a cup of perfection and savor the moments of pure bliss.', 20, 63, 8, 7, 8, ''),
(9, 'Wireless Headphones', 'Immerse yourself in the world of music with these wireless headphones. Featuring advanced Bluetooth technology, they provide a seamless and uninterrupted audio experience. The powerful drivers deliver crisp and immersive sound, while the noise-canceling feature blocks out unwanted distractions. With their comfortable fit and long battery life, you can enjoy your favorite tracks for hours on end. Step into a world of audio excellence with these high-quality wireless headphones.', 150, 30, 0, 1, 9, ''),
(10, 'Fitness Tracker', 'Stay motivated and achieve your fitness goals with this innovative fitness tracker. It monitors your daily activities, tracks your workouts, and measures your progress. With its built-in heart rate monitor and GPS, it provides accurate data to help optimize your training. The sleek and stylish design blends seamlessly with your active lifestyle. Stay connected with smart notifications and enjoy the convenience of wireless syncing. Take control of your health and embark on a journey towards a fitter you.', 80, 50, 0, 8, 10, ''),
(11, 'Educational Toy', 'Ignite your child\'s curiosity and spark their imagination with this educational toy. Designed to encourage learning through play, it offers interactive features and engaging activities. Stimulate their cognitive skills, creativity, and problem-solving abilities with this fun and educational toy. Made from safe and durable materials, it ensures long-lasting enjoyment. Watch your child learn and grow while having endless hours of fun.', 40, 14, 1, 9, 2, ''),
(12, 'Designer Sunglasses', 'Step out in style with these designer sunglasses. Crafted with precision and attention to detail, they offer both protection and fashion. The high-quality lenses provide 100% UV protection, ensuring your eyes are shielded from the suns harmful rays. With their sleek design and trendy frames, these sunglasses complement any outfit and exude confidence. Elevate your look and protect your eyes with these fashionable accessories.', 200, 0, 5, 4, 3, ''),
(13, 'Professional Camera', 'Capture lifes precious moments with this professional camera. Equipped with advanced features and high-resolution capabilities, it allows you to unleash your creativity and capture stunning photos and videos. From landscape shots to portraits, this camera delivers exceptional image quality and detail. Its intuitive controls and ergonomic design make it easy to use for both amateurs and professionals. Explore the world of photography and create memories that last a lifetime with this versatile camera.', 1500, 0, 5, 1, 1, ''),
(14, 'Premium Headphones', 'Immerse yourself in the ultimate audio experience with these premium headphones. Designed for audiophiles, they deliver studio-quality sound with rich and detailed audio reproduction. The over-ear design provides excellent noise isolation, allowing you to focus on your music without distractions. With their luxurious materials and comfortable fit, these headphones are perfect for extended listening sessions. Whether youre a music enthusiast or a professional audio engineer, these headphones will elevate your listening pleasure.', 300, 4, 4, 1, 2, ''),
(15, 'Designer Handbag', 'Make a fashion statement with this exquisite designer handbag. Crafted from premium materials, it combines elegance and functionality. The spacious interior offers ample storage for your essentials, while the stylish design adds a touch of sophistication to any outfit. With its attention to detail and impeccable craftsmanship, this handbag is a symbol of luxury and prestige. Carry your belongings in style and showcase your impeccable taste with this stunning accessory.', 500, 3, 12, 4, 4, ''),
(16, 'Smart Home Assistant', 'Transform your home into a smart sanctuary with this intelligent home assistant. With voice control and smart home integration, it simplifies your daily routines and enhances your lifestyle. From playing music and managing your calendar to controlling smart devices, this assistant does it all. Stay connected, get answers, and enjoy the convenience of a hands-free experience. Embrace the future of smart living and let this assistant be your reliable companion.', 100, 26, 4, 7, 5, ''),
(17, 'Premium Watch', 'Indulge in luxury with this premium watch. From its meticulously crafted design to its precise movement, every detail reflects exceptional quality. The premium materials and exquisite finishing ensure durability and elegance. With its timeless style and versatility, this watch is suitable for any occasion. Elevate your wrist with a symbol of luxury and sophistication that stands the test of time.', 800, 0, 8, 4, 6, ''),
(19, 'Fitness Equipment Set', 'Get in shape and stay active with this comprehensive fitness equipment set. It includes everything you need for a complete workout, from dumbbells and resistance bands to a yoga mat and exercise ball. Whether you prefer strength training, cardio exercises, or flexibility workouts, this set has you covered. Achieve your fitness goals and maintain a healthy lifestyle with this versatile and convenient fitness equipment set.', 400, 1, 7, 8, 9, ''),
(20, 'Gourmet Cooking Utensils', 'Unleash your culinary skills with this set of gourmet cooking utensils. Crafted with precision and quality, these utensils make cooking a joyous experience. From spatulas and whisks to tongs and ladles, each utensil is designed to perform flawlessly. The ergonomic handles ensure comfort and control, while the durable materials offer long-lasting durability. Elevate your cooking game and create delicious masterpieces with these gourmet cooking utensils.', 100, 0, 12, 9, 10, ''),
(21, 'Luxurious Bedding Set', 'Transform your bedroom into a luxurious oasis with this exquisite bedding set. The soft and plush materials provide ultimate comfort and a restful nights sleep. The elegant design and attention to detail add a touch of sophistication to your bedroom decor. With a variety of sizes and colors to choose from, this bedding set caters to your personal style. Experience the indulgence of a five-star hotel in the comfort of your own home.', 250, 0, 5, 7, 3, ''),
(22, 'Wireless Bluetooth Speaker', 'Take your music anywhere with this portable wireless Bluetooth speaker. Enjoy high-quality sound and immersive audio wherever you go. The compact and lightweight design makes it easy to carry, while the long battery life ensures hours of continuous playtime. With Bluetooth connectivity, you can wirelessly connect your devices and stream your favorite songs. Elevate your music experience and bring the party with you with this versatile Bluetooth speaker.', 80, 16, 4, 5, 4, ''),
(23, 'Premium Coffee Machine', 'Indulge in barista-quality coffee at home with this premium coffee machine. It features advanced brewing technology that extracts the rich flavors and aromas from your favorite coffee beans. With customizable settings and intuitive controls, you can brew the perfect cup of coffee to suit your taste. The sleek and modern design adds a touch of elegance to your kitchen countertop. Start your day with a perfect cup of coffee and enjoy the art of brewing at its finest.', 300, 6, 0, 1, 5, ''),
(24, 'Designer Sunglasses', 'Protect your eyes in style with these designer sunglasses. The high-quality lenses provide 100% UV protection and reduce glare for clear and comfortable vision. The fashionable frames complement your unique style and add a touch of sophistication to any outfit. Whether youre strolling on the beach or exploring the city, these sunglasses are a must-have accessory to shield your eyes and make a fashion statement.', 150, 0, 10, 4, 6, ''),
(26, 'Designer Watch', 'Make a statement with this luxurious designer watch. The exquisite craftsmanship and attention to detail make it a timeless accessory. The precision-engineered movement ensures accurate timekeeping, while the stylish design adds a touch of elegance to your wrist. With its durable materials and water resistance, this watch combines form and function in perfect harmony.', 500, 8, 0, 4, 7, ''),
(27, 'Professional Makeup Kit', 'Unleash your creativity with this professional makeup kit. It includes a wide range of high-quality products to help you achieve stunning makeup looks. From versatile eyeshadow palettes and long-lasting lipsticks to silky foundations and precise brushes, this kit has everything you need to express your unique style. Elevate your makeup game and let your creativity shine.', 200, 10, 0, 6, 8, ''),
(28, 'Smart Home Security Camera', 'Enhance the security of your home with this smart home security camera. It provides crystal-clear video surveillance, motion detection, and real-time alerts. With its advanced features, you can remotely monitor your property and ensure peace of mind. The easy setup and compatibility with smart devices make it a convenient addition to your smart home ecosystem.', 150, 12, 0, 7, 9, ''),
(29, 'Portable Power Bank', 'Stay connected on the go with this portable power bank. It provides reliable and fast charging for your devices, ensuring you never run out of battery power. The compact and lightweight design makes it easy to carry in your bag or pocket. With its high capacity, you can charge your smartphone multiple times before needing to recharge the power bank.', 50, 0, 20, 2, 10, ''),
(30, 'Wireless Gaming Headset', 'Immerse yourself in gaming with this wireless gaming headset. It offers high-quality sound, immersive audio, and clear communication with built-in microphones. The comfortable design and long battery life ensure hours of gaming without interruptions. Whether youre playing solo or engaging in multiplayer battles, this headset provides an enhanced gaming experience.', 100, 14, 1, 8, 3, ''),
(31, 'Premium Cookware Set', 'Upgrade your kitchen with this premium cookware set. It includes a variety of pots, pans, and utensils that are essential for every home chef. The durable materials and non-stick surfaces ensure even heat distribution and easy cooking. With this cookware set, you can prepare delicious meals with confidence and culinary finesse.', 300, 5, 0, 9, 4, ''),
(32, 'Fashionable Handbag', 'Accessorize in style with this fashionable handbag. The trendy design and high-quality craftsmanship make it a must-have accessory for any fashion-forward individual. With its spacious interior and multiple compartments, it offers both functionality and style. Carry your essentials with confidence and make a fashion statement wherever you go.', 150, 10, 0, 4, 5, ''),
(33, 'Smart Fitness Tracker', 'Track your fitness journey with this smart fitness tracker. It monitors your heart rate, steps, calories burned, and sleep patterns, providing valuable insights into your health and well-being. With its sleek and comfortable design, you can wear it all day and night. Stay motivated, set goals, and achieve a healthier lifestyle with this smart fitness tracker.', 80, 0, 20, 5, 6, ''),
(34, 'Educational Building Blocks', 'Spark creativity and learning with these educational building blocks. They promote cognitive development, problem-solving skills, and spatial awareness in children. With their vibrant colors and versatile shapes, these building blocks offer endless possibilities for imaginative play. Give your child a head start in their educational journey with these fun and educational building blocks.', 50, 15, 0, 6, 7, ''),
(35, 'Outdoor Adventure Backpack', 'Embark on thrilling outdoor adventures with this rugged and spacious backpack. It features multiple compartments, padded straps, and durable materials, making it perfect for hiking, camping, and backpacking. With its ergonomic design and ample storage space, this backpack provides comfort and convenience on your outdoor expeditions.', 100, 10, 0, 8, 8, ''),
(36, 'Wireless Earbuds', 'Experience wireless freedom with these high-quality wireless earbuds. They provide crisp sound, deep bass, and a comfortable fit. With their Bluetooth connectivity, you can enjoy your favorite music and take calls without the hassle of tangled wires. The compact charging case ensures extended battery life, making them perfect for on-the-go use.', 120, 8, 0, 5, 9, ''),
(37, 'Designer Perfume', 'Indulge in luxury with this designer perfume. The captivating fragrance and elegant packaging make it a sophisticated addition to your perfume collection. With its long-lasting scent, it leaves a lasting impression wherever you go. Discover the essence of luxury and embrace your signature scent with this exquisite designer perfume.', 200, 5, 7, 6, 10, ''),
(38, 'Smart LED Light Bulbs', 'Transform your home with these smart LED light bulbs. They offer a wide range of colors and adjustable brightness to create the perfect ambiance for any occasion. With their compatibility with voice assistants and smartphone apps, you can control the lights with ease. Set the mood, save energy, and create a smart lighting experience in your home.', 30, 17, 3, 2, 1, ''),
(39, 'Kids Educational Tablet', 'Inspire learning and creativity with this educational tablet for kids. It offers a wide range of educational games, interactive activities, and age-appropriate content. The kid-friendly design and parental controls ensure a safe and engaging learning experience. Give your child the gift of knowledge and exploration with this educational tablet.', 80, 0, 1, 3, 2, ''),
(40, 'Stylish Sunglasses', 'Shield your eyes in style with these stylish sunglasses. The trendy design, UV protection, and high-quality lenses make them a fashion accessory essential. Whether youre lounging at the beach or strolling through the city, these sunglasses add a touch of glamour to your look while protecting your eyes from the sun.', 80, 10, 0, 4, 3, ''),
