(43, 'Digital Camera', 'Capture your precious moments with this high-resolution digital camera. It features advanced technology and a variety of shooting modes to enhance your photography skills. With its compact size and user-friendly interface, its perfect for both beginners and enthusiasts. Preserve memories in stunning detail with this digital camera.', 300, 8, 0, 6, 5, ''),
(44, 'Wireless Gaming Mouse', 'Improve your gaming performance with this wireless gaming mouse. It offers precise tracking, customizable buttons, and ergonomic design for optimal comfort and control. With its lag-free wireless connection, you can enjoy seamless gaming sessions. Take your gaming to the next level with this reliable and responsive gaming mouse.', 50, 0, 5, 7, 6, ''),
(45, 'Designer Wallet', 'Add a touch of luxury to your accessories collection with this designer wallet. Its crafted from premium materials and features exquisite craftsmanship. With its multiple compartments and card slots, it offers both functionality and style. Carry your essentials in style with this elegant designer wallet.', 150, 10, 0, 4, 7, ''),
(46, 'Smart Home Thermostat', 'Take control of your homes temperature with this smart home thermostat. It allows you to remotely adjust the temperature and create customized schedules to maximize comfort and energy efficiency. With its intuitive interface and smart features, it learns your preferences and adapts to your lifestyle. Experience a smarter and more comfortable home with this smart thermostat.', 100, 12, 0, 5, 8, ''),
(47, 'Travel Backpack', 'Embark on your adventures with this versatile travel backpack. It offers ample storage space, comfortable straps, and durable materials for hassle-free travel. Whether youre hiking, backpacking, or exploring new cities, this backpack is designed to keep your belongings organized and secure. Travel in style and convenience with this reliable travel companion.', 80, 20, 0, 6, 9, ''),
(48, 'Professional Makeup Brushes', 'Achieve flawless makeup looks with this set of professional makeup brushes. They are crafted with high-quality bristles that allow for seamless application and blending. With a variety of brush types and sizes, this set caters to all your makeup needs. Elevate your makeup game and create stunning looks with these professional makeup brushes.', 50, 15, 0, 7, 10, ''),
