(51, 'Smart Fitness Watch', 'Track your health and fitness goals with this smart fitness watch. It monitors your heart rate, steps, calories burned, and sleep patterns, providing real-time insights and motivation. With its sleek design and user-friendly interface, it is the perfect companion for your active lifestyle. Stay on top of your fitness game with this advanced fitness watch.', 120, 6, 5, 3, 3, ''),
(52, 'Professional Chef Knife Set', 'Upgrade your kitchen arsenal with this professional chef knife set. It includes a versatile range of high-quality knives that are essential for every culinary task. With their razor-sharp blades and ergonomic handles, these knives offer precision and control for effortless food preparation. Elevate your cooking skills with this top-notch chef knife set.', 200, 10, 0, 4, 4, ''),
(53, 'Wireless Bluetooth Speaker', 'Take your music wherever you go with this wireless Bluetooth speaker. It delivers powerful sound, deep bass, and clear audio quality for an immersive listening experience. With its compact and portable design, it is perfect for outdoor adventures, parties, or simply enjoying music at home. Connect wirelessly and enjoy your favorite tunes with this versatile Bluetooth speaker.', 80, 20, 0, 5, 5, ''),
(54, 'Designer Sunglasses', 'Step out in style with these designer sunglasses. They feature a trendy design, UV protection, and high-quality lenses for both fashion and functionality. Whether you are lounging by the pool or exploring the city, these sunglasses add a touch of sophistication to your look while protecting your eyes from the sun. Embrace the allure of designer eyewear with these stylish sunglasses.', 150, 7, 5, 6, 6, ''),
(55, 'Smart Home Security System', 'Ensure the safety of your home with this smart home security system. It includes a combination of cameras, sensors, and alarms to provide comprehensive security coverage. With its advanced features, you can monitor your home remotely, receive instant alerts, and have peace of mind. Protect your loved ones and valuables with this state-of-the-art security system.', 300, 5, 0, 7, 7, ''),
(56, 'Wireless Gaming Keyboard', 'Enhance your gaming setup with this wireless gaming keyboard. It offers responsive keys, customizable backlighting, and programmable macros for a personalized gaming experience. With its wireless connectivity, you can enjoy a clutter-free gaming environment and seamless gameplay. Dominate the virtual battlefield with this high-performance gaming keyboard.', 100, 15, 0, 8, 8, ''),
